import {Navbar,Container} from 'react-bootstrap';

function Header() {
  return (
    <div>
      <Navbar bg="dark">
        <Container>
          <Navbar.Brand>Logo</Navbar.Brand>
          <Navbar.toggle aria-controls="basic-navbar-nav"></Navbar.toggle>
        </Container>
      </Navbar>
    </div>
  )
}

export default Header;
